SELECT p.first, p.last, a.code, a.description 
            FROM patients p 
            LEFT JOIN allergies a ON p.id=a.patient 
            WHERE a.code='Bee venom' 
            GROUP BY p.first, p.last, a.code, a.description 
            ORDER BY p.first, p.last, a.code, a.description;

